------------------------------

Banksy Does New York
On Oct. 1, 2013, the elusive British street artist known as Banksy launched a self-proclaimed month-long residency in New York City, posting one unique exhibit a day in an unannounced location, sparking a 31-day scavenger hunt both online and on the streets for Banksy's work. 
Capturing this month of madness, Banksy Does New York
incorporates user-generated content, from YouTube videos to Instagram photos, from New Yorkers and Banksy hunters alike, whose responses became part of the work itself, for an exhilarating, detailed account of the uproar created by the mysterious artist. 
With installations spanning all five boroughs of New York City, and including a mix of stencil graffiti, sculpture, video and performance art, Banksy touched on such wide-ranging subjects as fast-food wages, animal cruelty in the meat industry, civilian casualties in Iraq and the hypocrisy of the modern art world. Daily News reporter Beth Stebner, who covered Banksy's residency, was struck by the wide array of people drawn to his work, noting, &quot;You had art students, you had plumbers, you had gallery owners. It just brought New Yorkers out.&quot;

